function setAvailable(name) {

    var link = "https://3dhr.eu.ngrok.io/printers/set/available/name=" + name;
    $.ajax({
      type: 'PUT',
      url: link,
      data: false,
      processData: false,
      contentType: false,
      mode: 'cors',
      cache: false,
      crossDomain: true,
      timeout: 600000,
      success: function(data, status) {
          if(status != "Button 1 have been virtually pressed!"){
              toastr.error("PRINTER STATUS SET TO AVAILABLE");
          }else{
              ttoastr.error("PRINTER STATUS SET TO AVAILABLE");
          }
    
      },
      error: function(e) {
          toastr.error("Error updating status !");
      }
   });
}




function convertHMS(value) {
    const sec = parseInt(value, 10); // convert value to number if it's string
    let hours   = Math.floor(sec / 3600); // get hours
    let minutes = Math.floor((sec - (hours * 3600)) / 60); // get minutes
    let seconds = sec - (hours * 3600) - (minutes * 60); //  get seconds
    // add 0 if value < 10; Example: 2 => 02
    if (hours   < 10) {hours   = "0"+hours;}
    if (minutes < 10) {minutes = "0"+minutes;}
    if (seconds < 10) {seconds = "0"+seconds;}
    return hours+':'+minutes+':'+seconds; // Return is HH : MM : SS
}

function sortJSON(arr, key, way) {
      return arr.sort(function(a, b) {
        var x = a['printer_name']; var y = b['printer_name'];
          if (way === '123') { return ((x < y) ? -1 : ((x > y) ? 1 : 0)); }
          if (way === '321') { return ((x > y) ? -1 : ((x < y) ? 1 : 0)); }
      });
}

function updateFunction(data){
  var data = JSON.stringify(data);
  var data = jQuery.parseJSON(data);
  var data = sortJSON(data,'status', '123'); // 123 or 321
  $.each(data, function(index, element) {
            var statusid = "status" + element['printer_name'];
            var stattextid = "stattext" + element['printer_name'];
            var progressid = "perc" + element['printer_name'];
            var progressspan = "percspan" + element['printer_name'];
            var cardid = "card" + element['printer_name'];
            $('#'+progressid).text(element['done_percentage']);
            var widthstr = element['done_percentage'] + '%';
            $('#'+progressspan).css("width", widthstr);
            // console.log(element['status']);
            // console.log(element['done_percentage']);
            var perc = element['done_percentage'];
            var selector = '#'+progressspan+' > .percent';
            var statuscheck = element['status'];
            var icon = '';
            var styles = '';
            // status INT {IDLE:1, PRINTING:2. PAUSED:3, COMPLETE:4. ERROR:5}
            if( statuscheck == '1'){
              var icon = '<i class="fa fa-clock-o" aria-hidden="true"></i>';
              $('#'+statusid).html(icon);
              $('#'+stattextid).text('IDLE');
            }
            if( statuscheck == '2'){
              var icon = '<i class="fa fa-cog fa-cog-icon" aria-hidden="true"></i>';
              $('#'+statusid).html(icon);
              $('#'+stattextid).text('PRINTING');
            }
            if( statuscheck == '3'){
              var icon = '<i class="fa fa-pause fa-pause-icon" aria-hidden="true"></i>';
              $('#'+statusid).html(icon);
              $('#'+cardid).css("filter","grayscale(1)");
              $('#'+stattextid).text('PAUSED');
            }
            if( statuscheck == '4'){
              var icon = '<i class="fa fa-check-circle" aria-hidden="true"></i>';
              $('#'+statusid).html(icon);
              $('#'+stattextid).text('COMPLETE');
            }

            if( statuscheck == '5'){
              var icon = '<i class="fa fa-warning warning" aria-hidden="true"></i>';
              $('#'+statusid).html(icon);
              $('#'+stattextid).text('ERROR');
            }

            if(perc < 25){
              // console.log("FLOAT");
              // $(selector).css("color", "black");
              $(selector).css("margin-left", "20px");
            }else{
              // $(selector).css("color", "white");
              $(selector).css("margin-left", "initial");
            }
  });
}

